def mafft(genes, path_in, path_out, path_new_sp_seq):
    """Aligning all the sequences for each gene."""
    inputs = [path_in+genes, path_new_sp_seq+genes]
    outputs = [path_out+genes+"_aligned.fasta"] 
    options = {'cores': 8, 'memory': "100g", 'walltime': "12:00:00", 'account':"palms_phylogeny"}

    spec = """
    source /home/kris/miniconda3/etc/profile.d/conda.sh
    conda activate ame

    cd {path_in}
    mafft --add {path_new_sp_seq}{genes} --reorder {path_in}{genes} > {path_out}{genes}_aligned.fasta

    """.format(genes = genes, path_new_sp_seq=path_new_sp_seq, path_in = path_in, path_out=path_out)

    return (inputs, outputs, options, spec)

