def copy_gene_old_MSA(gene, path_in, path_out):
    """Copying genes that were aligned in the old MSA but for which the new species have no genes."""
    inputs = [path_in+gene]
    outputs = [path_out+gene+"_aligned.fasta"] 
    options = {'cores': 8, 'memory': "100g", 'walltime': "12:00:00", 'account':"palms_phylogeny"}

    spec = """
    
    cd {path_in}
    cp {gene} {path_out}{gene}_aligned.fasta

    """.format(gene = gene, path_in = path_in, path_out=path_out)

    return (inputs, outputs, options, spec)


